import Foundation
class RepeatedSubstringPattern {
    func repeatedSubstringPattern(_ s: String) -> Bool {
        guard s.count > 1 else { return false }
        let first = s.first!
        var sub = "\(first)"
        for c in s.dropFirst() {
            if sub.count * 2 > s.count {
                return false
            }
            if c != first {
                sub += String(c)
            } else {
                if let range = s.range(
                    of: sub,
                    range: Range(NSRange(location: sub.count, length: s.count-sub.count), in: s)
                ) {
                    let newSub = String(s.prefix(upTo: range.lowerBound))
                    if let isRepeated = isRepeatedSubstring(newSub, of: s) {
                        return isRepeated
                    } else {
                        sub += String(c)
                    }
                } else {
                    return false
                }
            }
        }
        
        return false
    }
    
    func isRepeatedSubstring(_ sub: String, of s: String) -> Bool? {
        guard s.count % sub.count == 0 else { return nil } // continue iterating
        var temp = s
        while sub == temp.prefix(sub.count) {
            temp.removeFirst(sub.count)
        }
        if temp.count == 0 {
            return true // exactly repeated substring
        }
        if temp.count > s.count / 2 {
            return nil // continue iterating
        }
        return false // the whole answer is false
    }

    func tests() {
        var date = Date()
        print(repeatedSubstringPattern(""))
        
        let d = Date()
        print(d.timeIntervalSince(date))
        print(repeatedSubstringPattern(""))
        date = Date()
        print(date.timeIntervalSince(d))
        print(repeatedSubstringPattern("")) // true
        print(-date.timeIntervalSinceNow)
        print(repeatedSubstringPattern("aabaaba")) // false
        print(repeatedSubstringPattern("aa")) // true
        print(repeatedSubstringPattern("aaaa")) // true
        print(repeatedSubstringPattern("abab")) // true
        print(repeatedSubstringPattern("aba")) // false
        print(repeatedSubstringPattern("abcabcabcabc")) // true
    }
}
